    # 1. create a graph
    # 2. get topological order
    # 3. check if the graph is a DAG
    # 4. if so, get the list of vertices

    n, m = [int(x) for x in stdin.split()]
    graph = defaultdict(list)

    for i in range(n):
        row = stdin[i]
        for j, ch in enumerate(row):
            if ch == "*":
                graph[(i, j)].append(i)
                graph[(i, j)].append(j)

    # topological sort
    # order of vertices, and the number of edges coming into each vertex
    in_degrees = {v: 0 for v in graph.keys()}

    for u in graph.keys():
        for v in graph[u]:
            in_degrees[v] += 1

    order = deque()
    for vertex, indegree in in_degrees.items():
        if indegree == 0:
            order.append(vertex)

    while order:
        u = order.popleft()
        for v in graph[u]:
            in_degrees[v] -= 1
            if in_degrees[v] == 0:
                order.append(v)

    # for u in graph:
    #     print(u, graph[u])

    # print(order)

    # for u in order:
    #     print(u)

    if len(order)!= n * m:
        return "NO"

    # check if it is a DAG
    for u in order:
        for v in graph[u]:
            if v not in order:
                return "NO"

    return "YES\n{} {}".format(order[0][0] + 1, order[0][1] + 1)

