    south_lines = [tuple(map(int, line.split())) for line in lines[2: 2 + n_south_lines]]
    east_lines = [tuple(map(int, line.split())) for line in lines[2 + n_south_lines:]]

    solution = 0

    for south_line in south_lines:
        for east_line in east_lines:
            points = list(map(lambda l: (l[0] + l[2], l[1] + l[3]), zip(south_line, east_line)))

            if points == []:
                solution += 1
            else:
                south_point, east_point = points[0]

                if south_point == east_point:
                    solution += abs(south_point)
                else:
                    # If the two lines cross each other, then there is a way of crossing them
                    if south_point > east_point:
                        solution += max(abs(south_point - east_point), 1)

                    else:
                        solution += max(abs(south_point - east_point), 1)

    if solution == 0:
