def solution(stdin: str) -> str:
    """
    This solution is inspired by the solution found here:
    https://stackoverflow.com/a/42989549/6732238
    """
    n, k = map(int, stdin.split(' '))
    field = [[char for char in row] for row in stdin.split('\n')]
    height, width = len(field), len(field[0])
    # assert k <= n - 1

    def neighbours(pos):
        i, j = pos
        yield (i + 1, j)
        yield (i - 1, j)
        yield (i, j + 1)
        yield (i, j - 1)

    def has_insect(pos):
        return field[pos[0]][pos[1]] == 'T'

    def insect_pos():
        for i in range(height):
            if has_insect((i, 0)):
                return i, 0
        for i in range(height):
            if has_insect((i, width - 1)):
                return i, width - 1
        for j in range(width):
            if has_insect((0, j)):
                return 0, j
        for j in range(width):
            if has_insect((height - 1, j)):
                return height - 1, j
        return None

    def is_in_boundary(pos):
        i, j = pos
        return 0 <= i < height and 0 <= j < width

    def next_cell(pos):
        i, j = pos
        for ni, nj in neighbours(pos):
            if is_in_boundary((ni, nj)):
                return ni, nj
        return None

    def path_to_insect():
        pos = insect_pos()
        if not pos:
            return None
        path = [pos]
        while True:
            pos = next_cell(pos)
            if not pos:
                return path
            path.append(pos)

    def path_to_insect_with_steps():
        pos = insect_pos()
        if not pos:
            return None
        path = [pos]
        while True:
            pos = next_cell(pos)
            if not pos:
                return path
            path.append(pos)
            if has_insect(pos):
                return path
            if has_insect(pos) and (path[-1][0] + 1) % k == 0:
                return path

    def all_paths():
        if not path_to_insect():
            return None
        for path in path_to_insect_with_steps():
            if path[-1] == (n, 0):
                return path

    def shortest_path():
        if not all_paths():
            return None
        return min(all_paths(), key=len)

    return 'YES' if shortest_path() else 'NO'

