        """Returns true if the two rectangles are solved (identical) or unsolvable."""
        return is_identical(rectangle1, rectangle2) or not is_valid(rectangle1) or not is_valid(rectangle2)

    def tile_distance(rectangle1, rectangle2):
        """Returns the distance between the two tiles in the first rectangle."""
        return abs(rectangle1.index('X') - rectangle2.index('X'))

    def can_cover(rectangle1, rectangle2):
