def solution(stdin: str) -> str:
    """
    Theory:
    Take the first person who is not the last person, find the length of their group (we know all groups are consecutive)
    If the length of group is less than K, then we don't need to take any persons
    If the length of group is equal to K, then we don't need to take any persons
    If the length of group is greater than K, then we must take the first one, and then find the person who is not the same as the last person in the group
        If the person is not the same as the last person, then we can take that person, and then recurse with the remainder of the group
    """
    length, K = list(map(int, stdin.split()))
    people = list(map(lambda x: x == "YES", stdin.split()))
    print(people)

    def solve(l, K):
        if l < K:
            return None
        elif l == K:
            return people[0]
        elif l > K:
            return people[0] if people[l-1]!= people[l-K-1] else None

    return "".join([solve(l, K) for l in range(1, length + 1)])

