    def cross(a, b):
        return a[0] * b[1] - a[1] * b[0]

    def dot(a, b):
        return a[0] * b[0] + a[1] * b[1]

    def distance(a, b):
        return (a[0] - b[0]) ** 2 + (a[1] - b[1]) ** 2

    # 1. all points should be on the same line
    # 2. there should be exactly one straight line
    # 3. no two points should be on the same line
    # 4. points should be in the order from left to right
    def is_valid(rebels, bases):
        lines = [{} for _ in range(n_rebels)]
        n_lines = [0 for _ in range(n_rebels)]

        for r, b in zip(rebels, bases):
            n_lines[r] = 1 if r not in lines[b] else lines[b][r] + 1
            lines[b][r] = n_lines[r]
            n_lines[r] += 1

        count_lines = sum(n_lines)
        if count_lines!= 2 * n_rebels or count_lines!= n_bases:
            return False

        straight = set()
        for b in range(n_bases):
            for r in range(n_rebels):
                if r in straight or r not in lines[b]:
                    continue
                for r2 in range(r + 1, n_rebels):
                    if r2 in straight or r2 not in lines[b]:
                        continue
                    if abs(cross(rebels[r], rebels[r2]))!= abs(cross(bases[b], bases[b])):
