    leader_nums = {x for x in range(1, n+1)}

    def backtrack(step):
        if step == m:
            if leader_nums == set():
                return True
            if set(leaders)!= set(leader_nums):
                return False
            return True
        for idx in range(len(leaders)):
            if leaders[idx] in leader_nums:
                leader_nums.remove(leaders[idx])
                leaders[idx] = step
                if backtrack(step+1):
                    return True
                leaders[idx] = leaders[idx] + 1
                leader_nums.add(leaders[idx])
        return False

    for x in range(1, n+1):
        leaders.append(x)
        if backtrack(x):
            return''.join(map(str, leaders))
        leaders.pop()
    return -1



