            k: int) -> Tuple[int, int]:
        if k == 0:
            return 0, 0
        elif k == 1:
            return arr[0], 0
        elif idx == len(arr) - 1:
            return arr[idx], arr[idx]
        elif k == n - 1:
            return arr[-1], arr[-1]

        best_left = dfs(arr, idx + 1, k - 1)
        best_right = dfs(arr, idx + 1, k)

        light_level = arr[idx]

        left_light_level = arr[idx] - best_right[1]
        right_light_level = arr[idx] - best_left[1]

        left_light_level = max(0, left_light_level)
        right_light_level = max(0, right_light_level)

        if left_light_level + right_light_level < light_level:
            return best_left
        elif left_light_level + right_light_level > light_level:
            return best_right
        else:
            return best_left if best_left[0] < best_right[0] else best_right

    result = dfs(arr, 0, k)
    return str(result[0]) +'' +''.join(str(i) for i in result[1])


