        queue = [start]
        visited = set(queue)
        distance = {start: 0}
        while queue:
            node = queue.pop(0)
            for v in roads[node]:
                if v not in visited:
                    queue.append(v)
                    visited.add(v)
                    distance[v] = distance[node] + 1
        return distance

    distances = {}
    for i in range(N):
        distances[i] = bfs(i)

    distances = list(distances.items())
    distances.sort(key=lambda x: x[1][max(x[0], attacked[0])])
    return''.join([str(i) for i in distances[0][0]])

