class Solution:
    def __init__(self, n, m, maze, moves):
        self.n = n
        self.m = m
        self.maze = maze
        self.moves = moves
        self.found_exit = False
        self.pos = [0, 0]

    def path_length(self):
        dist = 0
        for i, move in enumerate(self.moves):
            dist += self.move(move)
            if i == len(self.moves) - 1:
                self.found_exit = True
        return dist

    def move(self, move):
        if move == 'U':
            self.pos[0] -= 1
        elif move == 'D':
            self.pos[0] += 1
        elif move == 'L':
            self.pos[1] -= 1
        elif move == 'R':
            self.pos[1] += 1
        else:
            return 0
        if self.pos[0] >= 0 and self.pos[0] < self.n and self.pos[1] >= 0 and self.pos[1] < self.m and self.maze[self.pos[0]][self.pos[1]] == '.':
            return 1
        return 0

    def shortest_path(self):
        self.found_exit = False
        return self.path_length()

    def robot_paths(self):
        paths = []
        for i in range(4):
            self.moves = [chr(ord('0') + i), chr(ord('0') + (i + 1) % 4)]
            paths.append(self.shortest_path())
        return paths

